INSERT INTO `s_sgc_home` (`id_home`, `id_ef`, `producto`, `producto_nombre`, `cliente`, `cliente_logo`, `html`, `imagen`, `nosotros`, `preguntas_frecuentes`, `limite_cotizacion`, `max_cotizacion_usd`, `max_cotizacion_bs`, `max_emision_usd`, `max_emision_bs`, `edad_max`, `edad_min`, `max_detalle`, `monto_facultativo`, `anio`, `facturacion`, `implante`, `certificado_provisional`, `modalidad`, `web_service`, `id_usuario`, `activado`) VALUES
('@S#1$2013535524a4cf2d72.64450527', '@S#1$2013535524a35084c0.08148368', 'AU', 'Automotores', '', '', '<p>El Banco Econ&oacute;mico surge como prop&oacute;sito empresarial en diciembre de 1989 cuando un grupo de hombres de negocios de la regi&oacute;n de Santa Cruz, Bolivia, ligados principalmente a actividades productivas y de servicios, se re&uacute;ne con la inquietud de formar un proyecto financiero de largo alcance, que a partir de dicha regi&oacute;n, se expanda al resto del pa&iacute;s y m&aacute;s adelante, al exterior. El objetivo fundamental de esta idea era atender las demandas de la Peque&ntilde;a y Mediana Empresa, sectores no atendidos por la Banca tradicional en ese momento en Santa Cruz.</p><p>El Banco inicia sus actividades el d&iacute;a 7 de Febrero de 1991 con tres l&iacute;neas de negocio fundamentales: la colocaci&oacute;n de recursos, la captaci&oacute;n de fondos y la oferta de servicios financieros, mismos que est&aacute;n &iacute;ntimamente relacionados.</p><p>Desde su inauguraci&oacute;n, el Banco Econ&oacute;mico ha tenido un crecimiento sostenido y acelerado. En muchos casos proporcionalmente mayor al resto de los bancos del sistema financiero boliviano.</p><p>El Banco Econ&oacute;mico ha logrado en su corta vida un buen posicionamiento en el segmento de la peque&ntilde;a y mediana empresa, reforzado estos &uacute;ltimos a&ntilde;os por la buena aceptaci&oacute;n que ha tenido el proyecto ''Mi Socio'' enfocado principalmente a los segmentos de micro y peque&ntilde;os negocios.</p>', 'a34c3historia_01.jpg', '', '', 30, 900000, 0, 900000, 0, 70, 18, 30, 100000, 20, 0, 0, 1, 0, 0, '@S#1$2013527b94e5dd4b67.58612440', 1),
('@S#1$2013535524a5d6b7d6.17534276', '@S#1$2013535524a35084c0.08148368', 'TRD', 'Todo Riesgo Domiciliario', '', '', '<p>El Banco Econ&oacute;mico surge como prop&oacute;sito empresarial en diciembre de 1989 cuando un grupo de hombres de negocios de la regi&oacute;n de Santa Cruz, Bolivia, ligados principalmente a actividades productivas y de servicios, se re&uacute;ne con la inquietud de formar un proyecto financiero de largo alcance, que a partir de dicha regi&oacute;n, se expanda al resto del pa&iacute;s y m&aacute;s adelante, al exterior. El objetivo fundamental de esta idea era atender las demandas de la Peque&ntilde;a y Mediana Empresa, sectores no atendidos por la Banca tradicional en ese momento en Santa Cruz.</p><p>El Banco inicia sus actividades el d&iacute;a 7 de Febrero de 1991 con tres l&iacute;neas de negocio fundamentales: la colocaci&oacute;n de recursos, la captaci&oacute;n de fondos y la oferta de servicios financieros, mismos que est&aacute;n &iacute;ntimamente relacionados.</p><p>Desde su inauguraci&oacute;n, el Banco Econ&oacute;mico ha tenido un crecimiento sostenido y acelerado. En muchos casos proporcionalmente mayor al resto de los bancos del sistema financiero boliviano.</p><p>El Banco Econ&oacute;mico ha logrado en su corta vida un buen posicionamiento en el segmento de la peque&ntilde;a y mediana empresa, reforzado estos &uacute;ltimos a&ntilde;os por la buena aceptaci&oacute;n que ha tenido el proyecto ''Mi Socio'' enfocado principalmente a los segmentos de micro y peque&ntilde;os negocios.</p>', 'a3da3historia_03.jpg', '', '', 30, 1000000, 0, 1000000, 0, 70, 18, 10, 0, 0, 0, 0, 1, 0, 0, '@S#1$2013527b94e5dd4b67.58612440', 1),
